import React from 'react';
import {
    Navbar,
    Container
 } from 'react-bootstrap';

class NavBar extends React.Component {
    render() {
        const NavStyle = {
            background: '#D6B064',
            height: '85px',
        }
        return (
            <Navbar style={NavStyle} >
                <Container>

                </Container>
            </Navbar>
        );
    }
}

export default NavBar;
